import React from "react";

import NavBar from "./NavBar/NavBar.tsx";
import Presentation from "./Presentation.tsx";
import { SubFrontStyle } from "../../styles/FrontPageStyle/FrontPage.style.ts";

function SubFrontPage() {
  return (
    <SubFrontStyle>
      <NavBar />
      <Presentation />
    </SubFrontStyle>
  );
}
export default SubFrontPage;
